class Solution:
    def lastSubstring(self, s: str) -> str:
        res = None
        for i in range(122, 96, -1):
            loc = s.find(chr(i))
            while loc != -1:
                if not res:
                    res = s[loc:]
                else:
                    if res < s[loc:]:
                        res = s[loc:]
                # res.append(s[loc:])
                loc = s.find(chr(i), loc + 1)
        return res


a = Solution()
print(a.lastSubstring(
    ""))
